import { Button } from "@mui/material";
import React from "react";
import { Link } from "react-router-dom";
import { useSearchParams } from "react-router-dom";
const Users = () => {
  const [searchParam, setSearchParam] = useSearchParams({
    age: "20",
    name: "Abc",
  });
  console.log("age", searchParam.get("age"));
  const age = searchParam.get("age");
  const name = searchParam.get("name");
  const mystyle = {
    backgroundImage: "url('backgroundimg.jpg')",
    height: "93vh",
    padding: "50px",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  const linkstyle = {
    fontSize: "1.8em",
    align: "left",
  };

  const listContainerStyle = {
    textAlign: "left",
  };
  let users = [
    { id: 1, name: "Abir", email: "abir@gmail.com" },
    { id: 2, name: "Adya", email: "adya@gmail.com" },
    { id: 3, name: "Dhruv", email: "dhruv@gmail.com" },
    { id: 4, name: "Pratyush", email: "pratyush@gmail.com" },
    { id: 5, name: "Ryka", email: "ryka@gmail.com" },
  ];
  return (
    <div style={mystyle}>
      <h1>Users List</h1>
      <br />
      <ul style={listContainerStyle}>
        {users.map((item) => (
          <li key={item.id}>
            <Link to={`/users/${item.name}`} style={linkstyle}>
              {item.name}
            </Link>
          </li>
        ))}
        {/* <li style={linkstyle}>
            <Link to="/users/madhuri">Madhuri</Link>
            </li>
            <li style={linkstyle}>
            <Link to="/users/ashwini">Ashwini</Link>
            </li> */}
      </ul>

      <br />
      <h1>Use SearchParams Data:</h1>
      <h2>Name from searchParam:{name}</h2>
      <h2>Age from searchParam:{age}</h2>
      <Button onClick={() => setSearchParam({ age: "27", name: "Madhuri" })}>
        Update Query Params
      </Button>
    </div>
  );
};

export default Users;
